        public double GetLaplaceFunction(double x)
        {
            if(x < 0)
                return -GetLaplaceFunction(-x);
            if (x > 5)
                return 0.5;
            string s = (x * 100).ToString();
            s = s[0].ToString() + s[1].ToString() + s[2].ToString();
            if (s[0] == '3')
                s = s[0].ToString() + ','.ToString() +  s[1].ToString();
            else if (s[1] == ',')
                s = '0'.ToString() + ','.ToString() + s[0].ToString();
            else if (s[2] == ',')
                s = '0'.ToString() + ','.ToString() + s[0].ToString() + s[1].ToString();
            else
                s = s[0].ToString() + ',' + s[1].ToString() + s[2].ToString();
            double helpX = Double.Parse(s);
            if (s[0] == '3' && (helpX * 10) % 2 != 0)
            {
                s = s[0].ToString() + s[1].ToString() + (Int32.Parse(s[2].ToString()) + 1).ToString();
                helpX = Double.Parse(s);
            }
            else if (s[0] == '2' && (helpX * 100) % 2 != 0)
            {
                s = s[0].ToString() + s[1].ToString() + s[2].ToString() + (Int32.Parse(s[3].ToString()) + 1).ToString();
                helpX = Double.Parse(s);
            }
            else if (s[0] == '4' && (helpX * 100) % 5 != 0)
            {
                s = s[0].ToString() + s[1].ToString() + s[2].ToString();
                helpX = Double.Parse(s);
            }
            if (helpX > 0)
                return LaplaceFunction[helpX];
            return 0;
        }
        public double GetKeyLaplaceFunction(double fx)
        {
            foreach (var (key, item) in LaplaceFunction)
            {
                if(item == fx) return key;
            }
            return 0;
        }
        public double GetCriticalPointsPearsonDistribution(int k, double a)
        {
            string s = (a * 1000).ToString();
            if (s.Length == 2)
                s = "0,0" + s;
            else if(2 < s.Length && s[2] == ',')
                s = "0,0" + s.Remove(2);
            else 
                s = "0," + s;
            double helpA = Double.Parse(s);
            if (k < 0)
                return 0;
            if(k < 51)
                return CriticalPointsPearsonDistribution[$"{k}, {helpA}"];
            return -1;
        }
